import React from "react";
import Container from "../Container/Container";
import "./Navbar.css";

function Navbar() {
    return (
        <Navbar bg="light" expand="lg">
        <Container>
          <Navbar href="#home">Google Books Search Utility</Navbar>
        </Container>
      </Navbar>
    )
}

export default Navbar;
